import axios from 'axios';
import React, { useState } from 'react'
import { Link } from 'react-router-dom';

const Home = () => {

    const [name,setName]=useState("");
    const [type,setType]=useState("");
    const [status,setStatus]=useState("");
    const [lastcleandate,setLastCleanDate]=useState("");

    const handleSubmit = (e)=>{
        e.preventDefault();
        axios.post('http://localhost:3000/api/equipment',{
            name,type,status,lastcleandate
        })
        .then(response=>console.log(response.data));
        }

  return (
    <div>
        <form onSubmit={handleSubmit}>
                <label>Name:</label>
                <input type='text' placeholder='Name' onChange={(e)=>setName(e.target.value)}/><br></br>
                <label>Type:</label>
                <select onChange={(e)=>setType(e.target.value)}>
                    <option value="">--select--</option>
                    <option value="Machine">Machine</option>
                    <option value="Vessel">Vessel</option>
                    <option value="Tank">Tank</option>
                    <option value="Mixer">Mixer</option>
                </select><br></br>
                <label>Status:</label>
                <select onChange={(e)=>setStatus(e.target.value)}>
                    <option value="">--select--</option>
                    <option value="active">Active</option>
                    <option value="inactive">InActive</option>
                    <option value="under maintenance">Under Maintenance</option>
                </select><br></br>
                <label>LastCleanedDate:</label>
                <input type='Date' onChange={(e)=>setLastCleanDate(e.target.value)}/>
                <div>
                    <button>Edit</button>
                    <button>Delete</button>
                </div>
        </form>
        </div>
  )
}

export default Home
